import Cards from '../components/Cards'
import Footer from '../components/Footer'
import Header from '../components/Header'
import SideBar from '../components/SideBar'
import '../styles/Main.scss'

/**
* @author
* @function Home
**/

const Home = (props) => {
    const data_from_db = [
        {id: 32, name: 'jake kea', address: '203 test address rd.', province: 'Ontario', email: 'janedoe@hotmail.com', tel: '323 3232 2333', points: 323, prize: 'headphones', ballots: '3' },
        {id: 32, name: 'jake kea', address: '203 test address rd.', province: 'Ontario', email: 'janedoe@hotmail.com', tel: '323 3232 2333', points: 323, prize: 'headphones', ballots: '3' },
        {id: 32, name: 'jake kea', address: '203 test address rd.', province: 'Ontario', email: 'janedoe@hotmail.com', tel: '323 3232 2333', points: 323, prize: 'headphones', ballots: '3' },
        {id: 32, name: 'jake kea', address: '203 test address rd.', province: 'Ontario', email: 'janedoe@hotmail.com', tel: '323 3232 2333', points: 323, prize: 'headphones', ballots: '3' },
        {id: 32, name: 'jake kea', address: '203 test address rd.', province: 'Ontario', email: 'janedoe@hotmail.com', tel: '323 3232 2333', points: 323, prize: 'headphones', ballots: '3' }
    ]
const create_dict = (data) =>{
    for(var i=0; i<data.length; i++ ){
        console.log(data.id[i])
    }

}
    useEffect(()=>{
        fetch('https://bottlecapdev.pythonanywhere.com/test',{
            method: 'GET',
            headers: {'Content-Type': 'application/json',}
        }).then(response => response.json())
        .then((resp)=>{
            create_dict(resp)

        })
    },[])
  return(
    <div id='dash_Home'>
        <SideBar />
        <div id='content_holder'>
            <Header />
            <div id='content_wrapper'>
            <Cards />
            <div id='table_content'>
            <table> 
                <tr>
                    <th>Name</th>
                    <th>address</th>
                    <th>province</th>
                    <th>email</th>
                    <th>Tel</th>
                    <th>Points</th>
                    <th>Prize</th>
                    <th>Ballots</th>
                </tr>

                    {
                        data_from_db.map((data, index)=>{
                            return(
                            <tr>
                            <td>{data.name}</td>
                            <td>{data.address}</td>
                            <td>{data.province}</td>
                            <td>{data.email}</td>
                            <td>{data.tel}</td>
                            <td>{data.points}</td>
                            <td>{data.prize}</td>
                            <td>{data.ballots}</td>
                            </tr>
                            )
                        })
                    }

            </table>
            </div>
            <Footer data={data_from_db}/>

            </div>

        </div>

    </div>
   )

 }

export default Home
